def write_arrays(f, prefix, arr):
	f.write(prefix)
	for i in arr:
		f.write(u'L"' + i + u'", ')
	f.write(u'};\n')

def write_str_arrays(f, prefix, arr):
	f.write(prefix)
	for i in arr:
		f.write('L"' + i + '", ')
	f.write('};\n')

with io.open('translate.txt', 'w', encoding='utf-8') as f:
	write_arrays(f, unicode('static char *moves[] = {'), moves)
	write_arrays(f, unicode('static char *abilities[] = {'), abilities)
	write_arrays(f, unicode('static char *movesSorted[] = {'), movesSorted)
	
	#items = map(lambda x : x.decode('utf-8'), items)
